import asyncio
import random,os


async def Img_Down(dirName, fileName, url):
    imgByt = Html_Downloader.download(url)
    if imgByt:
        save_file_byte(dirName,fileName,imgByt.content)
        return imgByt.content
    return None


async def Img_Down_Crontab(bookData = None):
    """
    根据本子信息字典进行保存
    bookData = {
        "url": "",              # 本子详细页
        "id": "",               # 本子id
        "title": "",            # 本子名称
        "total": 0,             # 本子所有分页总数
        "getTotal": 0,          # 已经获取的分页总数
        "groupPagesList": [],   # exhentai 帮我们分页的url列表
        "subPagesList": [],     # 本子内容页url列表
        "imgUrlList": [],       # 本子图片url列表
    }
    :param bookData: dict，键值对的示例已给出
    :return:
    """
    if bookData:
        dirName = bookData["title"]
        urls = list(enumerate(bookData["imgUrlList"]))
        for url in urls:
            fileName = str(url[0]+1)+".jpg"
            job = Img_Down(dirName, fileName, url[-1])
            print(url)
            taskRes = asyncio.create_task(job,name=url)
            # await taskRes
    return None

def downLoaderSave(bookData):
    # 创建协程对象
    co = Img_Down_Crontab(bookData)
    asyncio.run(co)


